            "enName": "United Arab Emirates2",
            "shortCode": "AE2",
            "otherName": null
        }, {
            "id": 3,
            "createTime": "2021-03-08T07:04:59Z3",
            "updateTime": "2021-03-08T07:04:59Z3",
            "localName": "امارات متحده عربی3",
            "enName": "United Arab Emirates3",
            "shortCode": "AE3",
            "otherName": null
        }, {
            "id": 4,
            "createTime": "2021-03-08T07:04:59Z4",
            "updateTime": "2021-03-08T07:04:59Z4",
            "localName": "امارات متحده عربی4",
            "enName": "United Arab Emirates4",
            "shortCode": "AE4",
            "otherName": null
        }
    ]


    const createHeader = () => {
        // let arrayHeader = []
        columns.forEach(it => {
            arrayHeader.push(
                <th key={it.key}>
                    {it.title}
                </th>
            )
        })
        // return arrayHeader

    }

    const createData = (headerItem = []) => {
        let arrayData = []
        let obj = {}
        let headerIndex = []
        let body = [<tr>
            <td>1</td>
            <td>2</td>
            <td>3</td>
        </tr>]

        var obj_name = new Object();
        obj_name.property = "value";


        columns.forEach(it => {
            headerIndex.push(it.dataIndex)
        })

        data.forEach(it => {
            obj = {}
            headerIndex.forEach(h => {
                const obj_name = {};
                obj_name[h] = it[h];
                obj_name.value = it[h]
                obj = Object.assign({}, obj, obj_name)
            })
            arrayData.push(obj)
        })

        arrayData.map(object1 => {

            body.push(<tr> {test(object1)} </tr>)
        })



        return body
    }
    const test = (object1) => {
        let halfbody = []

        for (const [key, value] of Object.entries(object1)) {
            // console.log(`key =>>${key}: value=> ${value}`);
            halfbody.push(<td> {value}</td>)
        }
        return halfbody
    }

    return (
        <>
            <table style={{ width: "100%" }}>
                <thead >
                    <tr>
                        {createHeader()}
                    </tr>
                </thead>
                <th>Age</th>
                <tbody>
                    {createData()}
                    <td>Jill</td>

                    <td>Smith</td>
                    <tr>
                    </tr>
                    <td>Eve</td>
                    <td>50</td>
                    <td>Jackson</td>
                    <tr>
                    </tr>
                </tbody>
                <td>94</td>
            </table>
        </>
    );

}

